import React, { useEffect, useRef } from 'react';
import Header from '../components/Header';
import './CaseStudyHel.css';

function CaseStudyHel() {
  const titleRef = useRef(null);

  useEffect(() => {
    const adjustTitleSize = () => {
      const title = titleRef.current;
      if (!title) return;

      const container = title.parentElement;
      const containerWidth = container.offsetWidth;

      let fontSize = 100;
      title.style.fontSize = `${fontSize}px`;

      while (title.offsetWidth < containerWidth && fontSize < 1000) {
        fontSize += 1;
        title.style.fontSize = `${fontSize}px`;
      }

      while (title.offsetWidth > containerWidth && fontSize > 10) {
        fontSize -= 1;
        title.style.fontSize = `${fontSize}px`;
      }
    };

    adjustTitleSize();
    window.addEventListener('resize', adjustTitleSize);

    return () => window.removeEventListener('resize', adjustTitleSize);
  }, []);

  return (
    <div className="light-background">
      <Header isLight={true} />
      <div className="case-study-container">
        <div className="case-study-header">
          <div className="case-study-title-container">
            <h1 className="case-study-title" ref={titleRef}>New Hel.fi</h1>
          </div>
          <div className="case-study-intro">
            <p className="case-study-subtitle">Citizen-centric renewal of the largest website in Finland</p>
            <div className="case-study-details">
              <div className="case-study-detail">
                <h3>Services</h3>
                <p><span className="pill">UI/UX Design</span> <span className="pill">Design Leadership</span></p>
              </div>
              <div className="case-study-detail">
                <h3>Client</h3>
                <p>City of Helsinki</p>
              </div>
              <div className="case-study-detail">
                <h3>Year</h3>
                <p>2020-2022</p>
              </div>
            </div>
          </div>
        </div>

        <img className="case-study-image" src="/images/main-image.png" alt="New Hel.fi website mockups" />

        <section className="case-study-section">
          <h2>Background</h2>
          <h3>Old ways won't open new doors</h3>
          <p>The city of Helsinki's hel.fi was serving as one of the largest websites in Finland. However, it needed a comprehensive renewal to meet modern web standards and user expectations. This project aimed to create a more user-friendly and accessible digital presence for the city.</p>
        </section>

        <section className="case-study-section blue-background">
          <h2>Approach</h2>
          <h3>Translating the Helsinki brand into a digital experience</h3>
          <img src="/path/to/approach-image.jpg" alt="Helsinki brand digital experience" />
          <div className="approach-details">
            <div className="approach-item">
              <h4>Digital Brand Experience</h4>
              <p>We created a cohesive digital brand experience that aligns with Helsinki's visual identity.</p>
            </div>
            <div className="approach-item">
              <h4>Building a Solid Design System</h4>
              <p>We developed a comprehensive design system to ensure consistency across all digital touchpoints.</p>
            </div>
            <div className="approach-item">
              <h4>Rapid Prototyping and User Testing</h4>
              <p>We employed iterative design processes with frequent user testing to refine the user experience.</p>
            </div>
          </div>
        </section>

        <section className="case-study-section">
          <h2>Solution</h2>
          <h3>Integrating design into the city organization</h3>
          <p>The journey to create the whole hel.fi is ongoing and will altogether take more than two years. The scale of the project is so massive that the City of Helsinki's own design team has grown significantly during the process.</p>
          <img src="/path/to/design-system.jpg" alt="Helsinki Design System" className="full-width-image" />
        </section>

        <div className="case-study-quote blue-background">
          <p>"This new website has created the new visual and UI concept for city of Helsinki's main website and helped us to build our brand experience in the digital world. We have also been able to create new design capabilities inside the city organization by hiring and training our inhouse designers. This is in practice with documentation and training materials that helps our designers to create cohesive and accessible services."</p>
          <cite>Pekka Sauri, Deputy Mayor, City of Helsinki</cite>
        </div>

        <section className="selected-projects">
          <h2>Selected projects</h2>
          <div className="project-grid">
            {/* Add project cards here */}
          </div>
        </section>
      </div>
    </div>
  );
}

export default CaseStudyHel;
